                    <h5 className="card-title indigo-text darken-2">Ime vozila</h5>

                    <div>
                        <p>Naziv vozila + tip vozila</p>
                        <p>Filijala, rent servis</p>
                        <p>Cena i popust je </p>
                        <p>Datum od , datum do</p>
